        private static void MakeItRain()
        {
            _captureConfiguration = UrlCaptureConfiguration.Read();

            InstallCertificate();
            Logger.Log("Starting...");
            var tamperer = Start(_captureConfiguration);
            Logger.Log("Started.");
            Logger.Log("Press enter to exit!");
            Console.ReadLine();
            Logger.Log("Stopping...");
            Stop(tamperer);
            Logger.Log("Stopped.");
        }

        static RequestsTamperer Start(UrlCaptureConfiguration config)
        {
            var tamperer = new RequestsTamperer(config);
            FiddlerApplication.BeforeRequest += tamperer.BeforeRequest;

            const FiddlerCoreStartupFlags flags =
                FiddlerCoreStartupFlags.AllowRemoteClients |
                FiddlerCoreStartupFlags.CaptureLocalhostTraffic |
                FiddlerCoreStartupFlags.DecryptSSL |
                FiddlerCoreStartupFlags.MonitorAllConnections;

            FiddlerApplication.Startup(config.ProxyPort, flags);
            return tamperer;
        }

        static void Stop(RequestsTamperer tamperer)
        {
            FiddlerApplication.BeforeRequest -= tamperer.BeforeRequest;

            if (FiddlerApplication.IsStarted())
                FiddlerApplication.Shutdown();
        }

        public static bool InstallCertificate()
        {
            if (!string.IsNullOrEmpty(_captureConfiguration.Cert))
            {
                Logger.Log("Certificate already installed, reusing...");
                FiddlerApplication.Prefs.SetStringPref("fiddler.certmaker.bc.key", _captureConfiguration.Key);
                FiddlerApplication.Prefs.SetStringPref("fiddler.certmaker.bc.cert", _captureConfiguration.Cert);
            }

            if (!CertMaker.rootCertExists())
            {
                Logger.Log("Installing certificate...");
                if (!CertMaker.createRootCert())
                    return false;

                if (!CertMaker.trustRootCert())
                    return false;

                _captureConfiguration.Cert =
                    FiddlerApplication.Prefs.GetStringPref("fiddler.certmaker.bc.cert", null);
                _captureConfiguration.Key =
                    FiddlerApplication.Prefs.GetStringPref("fiddler.certmaker.bc.key", null);
                _captureConfiguration.Save();
            }

            return true;
        }

        public static bool UninstallCertificate()
        {
            if (CertMaker.rootCertExists())
            {
                if (!CertMaker.removeFiddlerGeneratedCerts(true))
                    return false;
            }
            _captureConfiguration.Cert = null;
            _captureConfiguration.Key = null;
            _captureConfiguration.Save();

            return true;
        }
